import React, { useState } from "react";
import DataTable from "react-data-table-component";
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import CommonScript from "./../CommonScript";
export default function AddStudent() {
    const columns = [
        {
            name: 'Student ID',
            selector:row=>row.studentid,
            sortable:true
        },
        {
            name:'Name',
            selector:row=>row.name,
            sortable:true
        },
        {
            name:'Class',
            selector:row=>row.class,
            sortable:true
        },
        {
            name:'Attendence',
            selector:row=>row.availability,
            sortable:true
        },
        {
            name:'Action',
            cell:(row)=><Button variant="contained" onClick={handleEditData}>Edit</Button>
        }
    ];


    const rows = [
        {studentid:'STU00001',name:'Sateesh Sangaru',class:'8'},
        {studentid:'STU00002',name:'Rachana',class:'6'},
        {studentid:'STU00003',name:'Gopi Prasanth',class:'9'},
        {studentid:'STU00004',name:'Sai Karthik',class:'4'},
        {studentid:'STU00005',name:'Ravi Kumar Korapana',class:'7'},
        {studentid:'STU00006',name:'Rama Rao Sangaru',class:'10'},
        {studentid:'STU00007',name:'Kishore',class:'5'},
        {studentid:'STU00008',name:'Sharath Chandra',class:'1'},
        {studentid:'STU00009',name:'Ashwini',class:'7'},
        {studentid:'STU00010',name:'Ram',class:'3'},
        {studentid:'STU00011',name:'Babu Salem',class:'10'},
        {studentid:'STU00012',name:'Santhosh',class:'8'},

    ];

    const handleEditData = (e) => {

    }

    const [records, setRecords] = useState(rows);

    const handleFilter = (e) =>{
        if(e.target.value){
            const newData = records.filter(row=>{
                return row.title.toLowerCase().includes(e.target.value.toLowerCase());
            });
            setRecords(newData);
        }else{
            setRecords(rows);
        }
    }

    return (
        <div className="mt-5">
            <CommonScript />
            <div className="container">
                <div style={{marginTop:'10px'}}>
                    <DataTable
                        columns={columns}
                        data={records}
                        fixedHeader
                        pagination
                        highlightOnHover
                        actions={
                            <Button variant="contained">Pdf</Button>
                        }
                        subHeader
                        subHeaderComponent={
                            <TextField
                                type="text"
                                placeholder="Search"
                                onChange={handleFilter}
                            />
                        }
                    >
                    </DataTable>
                </div>
            </div>
        </div>
    )
}
